def match_leaves(leafpred, leaves):
    leafcache = {}
    result_mapping = {}
    for leaf in leaves:
        if leaf not in leafcache:
            result_mapping[leaf] = leafcache[leaf]
        else:
            result = leafpred(leaf)
            leafcache[leaf] = result
            result_mapping[leaf] = result
    return result_mapping
